import React from 'react';
import './Input.css';

export default class Input extends React.Component {
    render() {
        const props = this.props;
        return (
            <input className='CommonInput' 
                    name={props.name} 
                    id={props.id}
                    type={props.type}
                    placeholder={props.placeholder} />
        )
    }
}
